webpackJsonp([0xed294c2b38b3],{1734:function(a,e){a.exports={data:{markdownRemark:{html:'<p>상해 국제 교육 교류 센터에 참여하여 사회 과학 주제 예비 선거에 참여했습니다.</p>\n<p>학술 연구의 성공, 주제 선택의 큰 부분, 주제 선택은 전제 조건입니다. 문제는 다른 사람들이 문제를 볼 수없는 곳에서 볼 수 있고, 다른 사람들은 일반적인 문제를 볼 수 있고, 수직 문제는 다른 사람들이 수평 문제를 보는 곳, 다른 사람들은 수직 문제를 볼 수 있습니다. 수평 적 주제는 모두 성공적인 학습을위한 전제 조건입니다. 문제는 학업 성취와 합리적인 감수성이 요구되며 문제의 특별한 이해가 있어야한다는 것입니다.</p>\n<p>따라서 학술 연구자는 새로운 분야, 즉 제작자의 개척자이기도합니다. 우리가 다른 사람들이 개척 한 곳에서만 재배한다면 분명히 큰 창의력은 없습니다. 모든 문제는 새로운 세계를 발견하는 것과 마찬가지로 새로운 영역을 찾는 것입니다.</p>\n<p>7:00에 Hua Ting Hotel은 "21 세기 국제 대도시를 향한"국제 심포지엄의 환영 리셉션에 참석합니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0181.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0181.md",frontmatter:{title:"11월 10일 목요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0181.md absPath of file >>> MarkdownRemark"}}}});
